import React from 'react';
import { LoginStyled } from './Login.style';

const Login = () => {
  return (
    <LoginStyled>
      <input type="text" placeholder="pseudo" />
      <input type="password" placeholder="mot de pass" />
      <button type="submit" value="connexion" />
    </LoginStyled>
  );
};

export { Login };
